import { ListItem } from './ListItem';

export class ItemList extends React.Component {
  render() {
    return (
      <div id="ListMainContent">
        {this.props.items.map(item => <ListItem item={item} key={item.id} onClick={() => {
          console.log('clicked')
          this.props.onSelect(item);
        }} />)}
      </div>
    );
  }
}
